import NavigationItem from './NavigationItem/NavigationItem';
import classes from './NavigationItems/NavigationItems.module.css';

const navigationItems = () => {
   return <div className={classes.NavigationItems}>
               <ul>
                    <NavigationItem link="/" exact>What we do</NavigationItem>
                    <NavigationItem link="/innovation">Innovation</NavigationItem>
                    <NavigationItem link="/ourwork">Our work</NavigationItem>
                    <NavigationItem link="/aboutus">About Us</NavigationItem>
               </ul>
          </div>
}

export default navigationItems;
